import React from 'react';
function App() {
  return (
    <div className='bg-green-60 inline-block space-x-4'>
      <ul>
        <li><a href="/" className=''>Home</a></li>
        <li><a href="/about">About</a></li>
        <li><a href="/contact">Contact</a></li>
        <li><a href="/products">Products</a></li>
      </ul>
    </div>
  );
}

export default App;
